import React, { useState } from 'react'

const Form = () => {

    const [text, setText] = useState('')

    const handleChange = (e) => {
        setText(e.target.value)
    }

  return (
    <div className='border-4 m-8 justify-center'>
        <div className='p-4'>
            <p>Enter the desired length of password:</p>
            <input type='text' className='w-[5rem]' onChange={handleChange} value={text}/>

        </div>

    </div>
  )
}

export default Form
